    <div class="intro"><h2>Dialectr</h2></div>
    <h1>江苏省方言地理</h1>
    <p>
      汉语及其方言具有悠久的历史。先秦经典《礼记·王制》中说：“中国夷蛮戎狄，皆有安居。和味宜服，利用备器，五方之民，言语不通，嗜欲不同。”汉语是世界上方言最为复杂的语言之一。关于现代汉语方言的分类和分区，主要有三种不同意见：七区说，即官话、吴语、湘语、闽语、粤语、赣语、客家话；十区说，即官话、晋语、徽语、吴语、闽语、粤语、客家话、湘语、赣语、平话；三区说，即北部方言（官话）、中部方言（吴语、湘语、赣语）、南部方言（闽语、粤语、客家话）。
    </p>
