    <p>
      江苏省境跨吴方言、江淮方言和北方方言三个方言区，在汉语地区算是方言复杂的省份。江苏又是经济、文化比较发达的省份，历史上出现不少方言文学和方言研究著作。
      江苏无疑是方言文献大省，为我们提供较为丰富的研究资料。上古时期，江苏境内散居着许多夷族、越族部落，他们各有自己的语言，后来被中原华夏语融合了，成为现在不同的方言。因此，方言中包含着其他语言的成分和复杂的融合过程，有待我们在做好描写研究的基础上，进一步做好历时的研究。
    </p>
    <p>
      大体上,
      长江以南是吴方言，长江以北至淮河两岸是江淮方言，淮河以北约一百公里以外是北方方言。自然地理与方言地理大体上相符合不是偶然的，而是几千年来历史发展的结果。运用现代语言学方法研究江苏方言，从本世纪20年代末开始。50年代的方言普查，以市县政府所在地为方言点，大规模进行调查，目的是找出方言和普通话间的对应规律，为推广普通话服务。习近平总书记指出，让城市留住记忆，让人们记住乡愁。今天的方言调查旨在保留乡土文化，留住那一抹地方的记忆。
    </p>
    <p>
      本站使用数据驱动的方言调查方法，通过收集志愿者的发音数据，以 wav2vec2.0
      提取声学特征，进而聚类生成方言分区地图。
    </p>
